        public static List<SolarDustAOT> GetSolarDustAOTs()
        {
            var solarDustAOT = new List<SolarDustAOT>();

            var what_if_small_aod_with_production = GetData("what_if_small_aod_with_production");
            var what_if_medium_aod_with_production = GetData("what_if_medium_aod_with_production");
            var what_if_high_aod_with_production = GetData("what_if_high_aod_with_production");

            var small_aod = JsonConvert.DeserializeObject<List<SolarDustData>>(what_if_small_aod_with_production);
            var medium_aod = JsonConvert.DeserializeObject<List<SolarDustData>>(what_if_medium_aod_with_production);
            var high_aod = JsonConvert.DeserializeObject<List<SolarDustData>>(what_if_high_aod_with_production);


            var joinedQuery =
                      (from s in small_aod
                       join m in medium_aod on s.timestamps equals m.timestamps
                       join h in high_aod on s.timestamps equals h.timestamps
                       select new SolarDustAOT()
                       {
                           date = DateTime.Parse(s.timestamps),
                           //Datetime = DateTime.ParseExact(t.date, format, CultureInfo.InvariantCulture, DateTimeStyles.AssumeUniversal),
                           withaot = s.production,
                           withsmallaot = s.production_corrected,
                           withmediumaot = m.production_corrected,
                           withhighaot = h.production_corrected,


                       }).ToList();


            return joinedQuery;
        }


