        public static List<SolarDustTable> GetSolarDustTable(string file)
        {

            var dataList = JsonConvert.DeserializeObject<List<SolarDustData>>(file);
            var joinedQuery =
                      (from s in dataList
                       select new SolarDustTable()
                       {
                           aot = s.aot,
                           ghi = s.ghi,
                           ghicorrected = s.ghi_corrected,
                           procuctioncorrected = s.production_corrected,
                           production = s.production,
                           reduction = s.reduction_,
                           timestamp = DateTime.Parse(s.timestamps)
                       }).ToList();
            return joinedQuery;
        }


