        public async static Task<WindDataResponse> GetWindDataDemoRemote()
        {

            var recorded = await GetWindOutput();
            var forecast = await GetWindForecast();

            var combinedData = new WindDataResponse();

            combinedData.ForecastData = (from f in forecast.wind_data
                         select new WindDataOutput()
                         {
                             Datetime = DateTime.Parse(f.timestamp) ,
                             AirSpeed = f.wind_speed_ms,
                             Direction = f.wind_direction,
                             PowerKw= f.power_wk
                         }).ToList();

   

            combinedData.OutputData = (from f in recorded.wind_data
                        select new WindDataOutput()
                        {
                            Datetime = DateTime.Parse(f.timestamp),
                            AirSpeed = f.wind_speed_ms,
                            Direction = f.wind_direction,
                            PowerKw = f.power_wk
                        }).ToList();


            combinedData.WindComparison =
                 (from r in recorded.wind_data
                  join f in forecast.wind_data on r.timestamp equals f.timestamp
                  select new OutputComparison()
                  {
                      Datetime = DateTime.Parse(f.timestamp),
                     OutputPower = r.power_wk,
                     ForecastPower = f.power_wk
                  }).ToList();


            combinedData.KpisData = new List<LabelValueDetails>
            {
                new LabelValueDetails {  Label = "Availability", Value = "100%", Details = "Percentage of wind turbines operational over a specified time period in order to measure the reliability and uptime of the wind farm assets.",Id=1 },
                new LabelValueDetails { Label = "Performance", Value = "69.13%", Details = " Ratio of actual power output to rated power in order to evaluate how effectively turbines are operating relative to their maximum capacity." ,Id=2},
                new LabelValueDetails { Label = "Efficiency", Value = "54.16%", Details = "Percentage of data points within acceptable bounds of the empirical power curve in order to identify deviations from expected performance to detect operational inefficiencies.",Id=3 }
            };

            return combinedData;
        }

        private static async Task<WindResponse> GetWindOutput()
        {
            var client = new HttpClient();
            var request = new HttpRequestMessage(HttpMethod.Post, "https://wind-sample-2.dev.desp.space/wind");

            var contentOutput = new StringContent("{\r\n    \"site\": \"Test Location\",\r\n    \"latitude\": 41.006,\r\n    \"longitude\": 25.870,\r\n    \"altitude\": 80,\r\n    \"from_date\": \"2024-11-20\",\r\n    \"to_date\": \"2024-11-30\",\r\n    \"request_id\": \"12345\",\"dataset_type\": \"recorded\"}", null, "application/json");
            request.Content = contentOutput;
            var response = await client.SendAsync(request);
            response.EnsureSuccessStatusCode();
            var responseString = await response.Content.ReadAsStringAsync();

            if (response.IsSuccessStatusCode)
            {
                var responseObject = JsonConvert.DeserializeObject<WindResponse>(responseString);
                return responseObject;
            }
            else
            {
                return new WindResponse(); ;
            }
        }


