            var forecastWin = await GetWindForecast();


            ////Solar
             var solarForecast = GetSolarDataDemoTop();
             var solarProduction = GetSolarDataDemoTable();
             var MeterologicalData = GetSolarDemoMeteoData();
 


           var outputData =
            (from r in recordedWind.wind_data
             join s in solarProduction on DateTime.Parse(r.timestamp) equals s.Datetime

             select new HybridDataOuput()
             {
                 Datetime = s.Datetime,
                 AirSpeedWind = r.wind_speed_ms,
                 AmbientTemperature = s.AmbientTemperature,
                 DirectionWind = r.wind_direction,
                 PowerKwSolar = s.PowerKw,
                 PowerKwWind = r.power_wk,
                 PowerKwTotal = s.PowerKw + r.power_wk,
                 SolarIrradiance = s.SolarIrradiation
             }).ToList();


            var forcastedData =
             (from r in forecastWin.wind_data
              join s in solarForecast on DateTime.Parse(r.timestamp) equals s.Datetime


              select new HybridDataOuput()
              {
                  Datetime = s.Datetime,
                  AirSpeedWind = r.wind_speed_ms,
                  AmbientTemperature = s.AmbientTemperature,
                  DirectionWind = r.wind_direction,
                  PowerKwSolar = s.PowerKw,
                  PowerKwWind = r.power_wk,
                  PowerKwTotal = s.PowerKw + r.power_wk,
                  SolarIrradiance = s.SolarIrradiation


              }).ToList();


            var hybridComparison =
               (from fw in forecastWin.wind_data
                join fs in solarForecast on DateTime.Parse(fw.timestamp) equals fs.Datetime
                join rw in recordedWind.wind_data on fs.Datetime equals DateTime.Parse(rw.timestamp)
                join rs in solarProduction on DateTime.Parse(rw.timestamp) equals rs.Datetime

                select new OutputComparison()
                {
                    Datetime = fs.Datetime,
                    ForecastPower = fw.power_wk + fs.PowerKw,
                    OutputPower = rw.power_wk + fs.PowerKw
                }).ToList();





            HybridDataResponse hybridDataResponse = new HybridDataResponse
            {
                OutputData = outputData,
                ForecastData = forcastedData,
                HybridComparison = hybridComparison
            };

            return hybridDataResponse;

