            //    return sampleData;
            }




















        public static HybridDataResponse GenerateSampleData(int count)
        {
            var random = new Random();
            var outputData = new List<HybridDataOuput>();
            var forecastData = new List<HybridDataOuput>();
            var hybridComparison = new List<OutputComparison>();

            DateTime datetimes = new DateTime(2024,11,21);


            for (int i = 0; i < count; i++)
            {
                DateTime datetime = datetimes.AddHours(i);
                double powerKwSolar = random.NextDouble() * 10;
                double solarIrradiation = random.Next(500, 1000);
                double ambientTemperature = random.Next(15, 35);
                double powerKwWind = random.NextDouble() * 5;
                double airSpeed = random.Next(2, 10);
                double direction = random.Next(0, 360);
                double powerKwTotal = powerKwSolar + powerKwWind;

                double forecastPowerKwSolar = powerKwSolar + (random.NextDouble() * 2 - 1);
                double forecastPowerKwWind = powerKwWind + (random.NextDouble() * 1 - 0.5);
                double forecastPowerKwTotal = forecastPowerKwSolar + forecastPowerKwWind;

                outputData.Add(new HybridDataOuput
                {
                    Datetime = datetime,
                    PowerKwSolar = powerKwSolar,
                    SolarIrradiance = solarIrradiation,
                    AmbientTemperature = ambientTemperature,
                    PowerKwWind = powerKwWind,
                    AirSpeedWind = airSpeed,
                    DirectionWind = direction,
                    PowerKwTotal = powerKwTotal
                });

                forecastData.Add(new HybridDataOuput
                {
                    Datetime = datetime,
                    PowerKwSolar = forecastPowerKwSolar,
                    SolarIrradiance = solarIrradiation + random.Next(-50, 50),
                    AmbientTemperature = ambientTemperature + random.Next(-2, 2),
                    PowerKwWind = forecastPowerKwWind,
                    AirSpeedWind = airSpeed + random.NextDouble() * 2 - 1,
                    DirectionWind = direction + random.Next(-10, 10),
                    PowerKwTotal = forecastPowerKwTotal
                });

                hybridComparison.Add(new OutputComparison
                {
                    Datetime = datetime,
                    ForecastPower = forecastPowerKwTotal,
                    OutputPower = powerKwTotal
                });
            }

            return new HybridDataResponse
            {
                OutputData = outputData,
                ForecastData = forecastData,
                HybridComparison = hybridComparison
            };
        }




        public static List<MeterologicalData> GetSolarDemoMeteoData()
        {
            var solarDataDemoTop = GetSolarDataDemoTop().OrderBy(p=>p.Datetime);
            var solarDataDemoTable = GetSolarDataDemoTable().OrderBy(p => p.Datetime);

            foreach (var record in solarDataDemoTop)
            {
                record.Datetime = record.Datetime.AddHours(2);
            }



            var joinedQuery =
            (from t in solarDataDemoTop
             join p in solarDataDemoTable on t.Datetime equals p.Datetime

             select new MeterologicalData()
             {
                 //Datetime = DateTime.Parse(t.date),
                 Datetime = t.Datetime,
                 AmbientTemperature = p.PowerKw,
                 SolarIrradiationDust = t.PowerKw


             }).ToList();


            return joinedQuery;
        }
