        public static List<SolarDataResponseRecords> GetSolarDataDemoTable()
        {
        
        
            var simpleSolar = SimpleSolarData();

            var joinedQuery =
                      (from t in simpleSolar
                      
                       select new SolarDataResponseRecords()
                       {
                           //Datetime = DateTime.Parse(t.date),
                           Datetime = DateTime.ParseExact(t.timestamp, "yyyy-MM-dd HH:mm:ss", CultureInfo.InvariantCulture),
                           PowerKw = t.powerKw,
                           SolarIrradiation = t.solarIrradiation,
                           AmbientTemperature =  t.ambientTemperature,
                           PowerKwDust = 0,
                           SolarIrradiationDust = 0
                       }).ToList();

            return joinedQuery;
        }

